import React from 'react';
import "./Investment.css";

const Investment = () => {
  return (
    <div className='investment-container'>
    <h1 class="investment-title">Investment Options</h1>

    <section class="join-security-investment">
      <h2> <span>Security Investment</span> <br /> Course</h2>
      <p>
      LisaConsult provides an outstanding services for customers who are looking to invest in <span>Cryptocurrency</span>, <span>Equities</span>, <span>Real estate </span>and <span>bonds</span>. If you are chasing your dream, come to LisaConsult to make your dream come true.
      </p>
      <p>In case of any inconvenience, LisaConsult will refund your money. The only mission of LisaConsult is to serve you to make your dream come true.</p>
      <p>Click "Join us" below to fill out the form and enjoy the course of your dreams to unlock your untapped potential.</p>
      <a class="join-us-link" href="registrationForm.html">Join Us</a>
    </section>
    </div>
  )
}

export default Investment;
